                        <div class="col-md-8 text-left">
                            <h4>Dr. Khushboo Shah</h4>
                            <p>“Earthlings, to put in short is a platform for me to be the change I’d like to see in the world. For me it is an amalgamation of the philosophies I believe in with the things I love to do, to make change practical and available for everyone through just fun.”</p>
                            <p>Founder of Earthlings (Holy cow, I’m going to be a mother earthling!), Access Consciousness Bars and Body Process Facilitator (call me the possibility scientist), Clinical Hypnotherapist (multiverse believer and it sounds fancy), Drummmmmmerrrrr (my talent of using dandiyas and hands as drum sticks is beyond compare), Energetic Synthesis of Structural Embodiment Practitioner (biiiiggg words, I know.. but your body will love it), Visual Art Therapy facilitator (umm cause any hobby can be turned into therapy), Talk to the Entities Practitioner (spoooookyyyy),  Dentist by education (meet me only if you want to break ‘em), Teacher (ma’am’s work always in progress), Inventor of the no-pulse rhythm (if you’re wondering what happened to the pulses.. pssss.. I ate ‘em all), Coffee-drinker (actually I’m a coffee based life-form).</p>
                        </div>
