                        <div class="col-md-8 text-left">
                            <h4>Chandrakant Redican</h4>
                            <p>“I believe in the ability of poetry to facilitate change and make a real difference in people’s lives.”</p>
                            <p>Half Irish man from Jejuri (angrezi mei ‘liberal’), I’m a hunter and the mic is my gun (#poet and my rhyme-time is 14½×7), Teacher (I love chilling with my students), Storyteller (you’ve already heard one of my stories- rumour has it all), Zoologist (grew up watching man vs wild- now I know how things influence you when you are a kid), Meme Dada (if I don't like you or you don't like me.. you’re memed!!!), Slammer (I slam words, not doors, either way it hits.. my personal therapy funda)</p>
