                            <div class="col-md-8 text-left">
                                <h4>Akshata Parekh</h4>
                                <p>“I choose to be an Earthling because I love working with different people towards change”</p>
                                <p>I’m a woman of steel (with a bubble aura and an ability to give the warmest hugs, it’s almost a super power), Dancing diva: Pursuing MA in BharatNatyam (born to break a leg), Counsellor, and NLP Practitioner (Miss. Opportunist), Art Based Therapist (giant healing tornado), Dance Movement Facilitator (‘potli’ of energy), Access Bars Practitioner (cause anything with the word 'Bar’ intrigues me), Energetic Synthesis of Structural Embodiment Practitioner (check our founders profile, you'll know), Learner (always thirsty to learn),
                                    <br />Best described by the wise
                                    <br />“Things standing shall fall but
                                    <br />The moving ever shall stay”</p>
