                                <h4>Rujuta Mahajan</h4>
                                <p>“Why am I here? (So this is one of those days I’m procrastinating so you can ask me when me meet)”</p>
                                <p>Earthlings (the only sensible choice I've ever made), Foodie (yes, it's a warning to the home cooks out there), Pj-teller (meet me to know if it's true), Passionately curious (basically I question everything), Children and Animal lover (cause I fit in with them at first sight), Nature junkie (ask the poet, he coined the term), Psych-no-logist (pun intended), Access bars practitioner (ask the drummer- she facilitated me), Hypnotherapist (and no, I don't hypnotize with a pendulum nor do I have blue eyes), Time-traveler (self-proclaimed).</p>
